//SPDX-License-Identifier: MIT

pragma solidity 0.8.18;

interface SwapInterface{

    function GetAddress(string calldata name) external view returns(address);

    function approve(address spender, uint256 value) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
    function transferFrom(address from, address to, uint256 value) external returns (bool);


    function swapExactETHForTokens(uint amountOutMin, address[] calldata path, address to, uint deadline) external payable returns (uint[] memory);
    function swapExactTokensForETH(uint amountIn, uint amountOutMin, address[] calldata path, address to, uint deadline) external returns (uint[] memory);
}

contract Swap{

    string constant public Name = "Payment.Swap";

    address constant private workspaceAddress = 0x7F6b1F900113A9b46E4F38395bFC28075324a9F4;
    SwapInterface constant private ws = SwapInterface(workspaceAddress);

//-----------------------------------------------------------------------//

    address constant private routerAddress = 0xb3eB6c96083F8a3407A3C6a011E807e152448ba0;
    SwapInterface constant private rt = SwapInterface(routerAddress);

//-----------------------------------------------------------------------//

function SwapExactMATICForToken(address _token) external payable returns (uint[] memory amounts){

    address[] memory path = new address[](2);
    path[0] = 0x0d500B1d8E8eF31E21C99d1Db9A6444d3ADf1270;
    path[1] = _token;

    return(rt.swapExactETHForTokens{value : msg.value}(0, path, msg.sender, 2**256-1));
}

function SwapExactTokenForMATIC(address _token, uint256 _amount) external returns (uint[] memory amounts){

    SwapInterface tk = SwapInterface(_token);

    if(tk.allowance(address(this), routerAddress) < _amount)
        tk.approve(routerAddress, 2**256-1);

    if(tk.allowance(msg.sender, address(this)) < _amount)
        revert("Approval required");

    tk.transferFrom(msg.sender, address(this), _amount);

    address[] memory path = new address[](2);
    path[0] = _token;
    path[1] = 0x0d500B1d8E8eF31E21C99d1Db9A6444d3ADf1270;

    return(rt.swapExactTokensForETH(_amount, 0, path, msg.sender, 2**256-1));
}

//-----------------------------------------------------------------------//

    receive() external payable{

        revert(); 
    }

    fallback() external{
        
        revert();   
    }

}

